import React from 'react';
import './menustyle.css';
import {Link} from 'react-router-dom';

const Menu = () =>{
    return(
        <div className = "menustyle">
            <ul>
                <li><Link to>Home</Link></li>
                <li>About</li>
                <li>contact</li>
            </ul>
        </div>
    )
}


export default Menu;
